    constructor(props) {
        super(props);

        this.state = {
        moods:[],
        mood_id:0,
        mood_name:"",
        mood_time:""
        }
    }
    render(){
        return(
            <div>
            <h3>This is Viewer page</h3>
            <table className="table table-striped">
                    <thead>
                        <tr>
                            <th>
                               Mood Id
                            </th>
                            <th>
                            Mood Name
                            </th>
                            <th>
                                Mood time stamp
                            </th>
                        </tr>
                    </thead>
                    <tbody>
                        {moods.map(md =>
                            <tr key={md.mood_id}>
                                <td>{md.mood_id}</td>
                                <td>{md.mood_name}</td>
                                <td>{md.mood_time}</td>
                            </tr>
                        )}
                    </tbody>
                </table>
            </div>
        )
    }
}
